import { Component, OnInit, OnDestroy } from "@angular/core";
import { BoxService } from "../services";
import { Box } from "../models/box.model";

@Component({
  selector: 'app-interface-ui',
  templateUrl: './interface-ui.component.html',
  styleUrls: ['./interface-ui.component.css']
})
export class InterfaceUIComponent implements OnInit, OnDestroy {
  box: Box | undefined;

  constructor(private boxService: BoxService) { }

  ngOnInit() {
    this.createBox();
  }

  createBox() {
    const message = 'Hello from Angular'; // Replace with your desired message
    this.boxService.createBox(message).subscribe(
      (response) => {
        this.box = response;
        console.log('Box created:', this.box);
      },
      (error) => {
        console.error('Error creating box:', error);
      }
    );
  }

  ngOnDestroy() {
    // Clean up any subscriptions or resources if needed
  }
}
